import React from 'react';
import cl from '../css/Main.module.css';

const Main = () => {
    return (
        <div>
            <p className={cl.header}>Выполнено студентом гр. 22-Д9-3ИНС Гаврилюк Н.</p>
        </div>
    );
};

export default Main;
